(lib.Snows = function(mode,startPosition,loop) {
	this.initialize(mode,startPosition,loop,{});

	// timeline functions:
	this.frame_0 = function() {
		// Make a tick
		createjs.Ticker.addEventListener("tick", Tick); //addEventListener(Event.ENTER_FRAME, Tick);
		
		// Add Snow
		var Flake = new Array();
		const ZZ = 100;
		var XX=-ZZ;
		var YY=-ZZ;
		var numFlakes = 30;
		
		for(var n=0; n< numFlakes; n++)
		{
			Flake[n] = new lib.flake(); //Flake[n] = new flake();
			Flake[n].scaleX = Flake[n].scaleY = 0.3 * (1 + Math.random());
			Flake[n].Yspeed = (Math.random() - 2) * 2;
			Flake[n].Xspeed = (Math.random() - 0.5) * 7;
			Flake[n].x = XX + Math.random() * ZZ*2;
			Flake[n].y = YY +  Math.random() * ZZ*2;
			Flake[n].rotate = Math.random();
			this.addChild(Flake[n]);  ///addChild(Flake[n]);
		}
		
		function Tick(e)
		{
			for(var n=0; n< numFlakes; n++)
			{
				Flake[n].y -= Flake[n].Yspeed;
				Flake[n].x -= Flake[n].Xspeed;
				if(Flake[n].y > 200)
				{
					Flake[n].y = XX;
					Flake[n].x = YY+ Math.random() * ZZ*2;
				}
			}
			
		}
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(1));

}).prototype = getMCSymbolPrototype(lib.Snows, new cjs.Rectangle(0,0,0,0), null);


